//got TLE, may be leetcode's bug.
func dailyTemperatures(t []int) []int {
	ret := make([]int, len(t))
	st := [30001]int{}
	idx := 0
	for i := 0; i < len(t); i++ {
		for idx > 0 && t[st[idx-1]] < t[i] {
			ret[st[idx-1]] = i - st[idx-1]
			idx--
		}
		st[idx] = i
		idx++
	}
	return ret
}
